import { AUTH3} from '../constants/actionTypes';
import * as api from '../api/index.js';

export const signInAdmin = (formData, router) => async (dispatch) => {
  try {
    const { data } = await api.signInAdmin(formData);

    dispatch({ type: AUTH3, data });

    router('/');
  } catch (error) {
    console.log(error);
  }
};
